import React from 'react';
import Form from './components/Form';
import {Switch, Route} from 'react-router-dom'

function App(props) {
  function handleStart() {
    console.log('I was clicked!')
  }
  return (
    <>
    <div onClick={handleStart}>
      <h1> Name Rater </h1>
      <button value='Press Start!'/>
    </div>
      <Form />
    </>
  );
}

export default App;
